<script>
import sharedMixin from "../shared"
import progressTrackerMixin from "../progresstracker"
export default {
  name: 'StudentForm',

  mixins: [sharedMixin, progressTrackerMixin],

  // extended with sharedMixin
  created() {
    this.recalcForm();
  },

  // props extended with sharedMixin

  // extended with sharedMixin
  data() {
    return {
      currentStep: 1,
      choosingParts: false,
      chosenParts: [],
      estimatedHoursCalculated: 0,
      estimatedDaysCalculated: 0,
      estimatedMinutesCalculated: 0,

      expanded_block: false
    }
  },

  // extended with sharedMixin
  methods: {
    beginJourney() {
      this.currentStep = 2;
      this.skippedForm = false;
      this._saveLocalStorage()
    },
    skipForm() {
      this.skippedForm = true;
      this.currentStep = 4;
      this._clearLearningProcess();
      this._saveLocalStorage()
    },
    iWantBecomeSpecialist() {
      this.wish = this.BECOME_SPECIALIST
      this.usingApp = ""
      this._saveLocalStorage()
    },
    iWantBringKuber() {
      this.wish = this.BRING_KUBERNETES
      this.usingApp = ""
      this._saveLocalStorage()
    },
    iWantSolveTasks() {
      this.wish = this.SOLVE_TASKS
      this.usingApp = ""
      this._saveLocalStorage()
    },
    useApp(app) {
      this.usingApp = app
      this._saveLocalStorage()
    },
    passToPartsChoosing() {
      this.currentStep = 3
    },
    formComplete(event) {
      this._progresstracker_complete_form(this.wish, this.learningProgress);
      this.currentStep = 4
    },

    /**
     * Помогает подставлять в текст правильные окончания словам
     *   _declOfNum(1, ['минута', 'минуты', 'минут']); // вернёт — минута
     *   _declOfNum(2, ['минута', 'минуты', 'минут']); // вернёт — минуты
     *   _declOfNum(5, ['минута', 'минуты', 'минут']); // вернёт — минут
     * @param n
     * @param text_forms
     * @returns {*}
     */
    _declOfNum(n, text_forms) {
      n = Math.abs(n) % 100; var n1 = n % 10;
      if (n > 10 && n < 20) { return text_forms[2]; }
      if (n1 > 1 && n1 < 5) { return text_forms[1]; }
      if (n1 === 1) { return text_forms[0]; }
      return text_forms[2];
    },

    clickExpand(event) {
      this.expanded_block = ! this.expanded_block;
      event.preventDefault();
    },
  }
}
</script>
